        <ul>
            <li>Learn React</li>
            <li>Build Awesome App</li>
        </ul>
    );
};

const el = (
    <div>
        <h1>My Todo List</h1>
        <input placeholder="search"/>
        <TodoList />

    </div>
);

ReactDom.render (el, document.getElementById("root"));
